# Given: A DNA string s of length at most 1000 nt

# Return: Four integers (separated by spaces) counting 
# the respective number of times that the symbols 'A', 'C', 'G', 
# and 'T' occur in s

sequence = ''
adenine = []
thymine = []
guanine = []
cytosine = []

for nt in sequence:
    if nt == 'A':
        adenine.append(nt)
    if nt == 'T':
        thymine.append(nt)
    if nt == 'G':
        guanine.append(nt)
    
    if nt == 'C':
        cytosine.append(nt)
    
print(f'{len(adenine)} {len(cytosine)} {len(guanine)} {len(thymine)}')